const EURUSDrate = () =>  {

    const ws = new WebSocket('ws://stream.tradingeconomics.com/?client=b0qrdvv5sno7b3c:pjdm9hy5gjypuyk');

    //b0qrdvv5sno7b3c:pjdm9hy5gjypuyk
    // fetch("https://api.tradingeconomics.com/country/united-states/?client=guest:guest").then(response=>{
    //     console.log(response)
    // })
    ws.onmessage = function (event) {
        console.log(event.data)}

       ws.onopen = function () {
            console.log('Socket is Open!');
            //subscripe to a topic:
            const topic = 'calendar';
            ws.send('{"topic": "subscribe", "to": "'+topic+'"}');
            ws.send('{"topic": "subscribe", "to": "EURUSD"}');        };
    

    return <div><p></p></div>;
}

export default EURUSDrate;
